import React from 'react';

const KeyInfoCard = ({ icon, label, value }) => {
  return (
    <div className="key-info-card">
      <i className={icon}></i>
      <div>
        <p>{label}</p>
        <p>{value}</p>
      </div>
    </div>
  );
};

export default KeyInfoCard;
